import React, { Component } from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import LoginComponent from "../todo/LoginComponent.jsx";
import ListTodosComponent from "../todo/ListTodosComponent.jsx";
import TodoComponent from "../todo/TodoComponent.jsx";
import QuestionComponent from "./QuestionComponent.jsx";

class QA extends Component {
  render() {
    return (
      <div className="TodoApp">
        <QuestionComponent />
        <Router>
          <>
            <Switch>
              <Route path="/" exact component={LoginComponent} />
              <Route path="/login" component={LoginComponent} />
              <Route path="/todos/:id" component={TodoComponent} />
              <Route path="/todos" component={ListTodosComponent} />
            </Switch>
          </>
        </Router>
      </div>
    );
  }
}

export default QA;
